pragma solidity ^0.5.0;

contract ReadingList {


    struct Link {
        uint id;
        string url;
        // dateIn
        // dateOut
        uint upVotes;
    }

    struct Slot {
        uint id;
        uint linkId;
    }

    // store item in slot

    // read item from slot
    mapping(uint => Link) public links;
    mapping(uint => Slot) public slots;

    uint public linksCount;

    uint public slotsCount;

    event LinkAdded(
        address indexed from,
        string url,
        uint slot
    );

    constructor() public {
        addSlot();
        addSlot();
        addSlot();
        addSlot();
        addSlot();

        addLink('https://eand.co/why-the-21st-century-needs-a-new-kind-of-mind-d371d10b2024', 1);

    }

    function addLink (string memory _url, uint _slot) public {

        // msg.sender

        require(_slot > 0 && _slot <= slotsCount);

        linksCount ++;
        links[linksCount] = Link(linksCount, _url, 0);
        slots[_slot].linkId = linksCount;

        emit LinkAdded(msg.sender, _url, _slot);
    }
    function addSlot () private {
        slotsCount ++;
        slots[slotsCount] = Slot(slotsCount,0);
    }
}
